import './BoutiqueMenu.css'
import { useEffect, useState } from "react";
import { useDispatch } from "react-redux";
import { fetchProducts } from "../../redux/products/productsReducer";


export default function BoutiqueMenu() {


const dispatch = useDispatch()

 const productsBonnet = () =>{
   dispatch(fetchBonnet())
 }
 const productsTourDeCou = () =>{
   dispatch(fetchTourDeCou())
 }
 const productsPull = () =>{
   dispatch(fetchPull())
 }
 const productsGant = () =>{
   dispatch(fetchGant())
 }
 const productsChaussette = () =>{
   dispatch(fetchChaussette())
 }
 const productsChausson = () =>{
   dispatch(fetchChausson())
 }
 const productsPlaide = () =>{
   dispatch(fetchPlaide())
 }
 const productsPelote = () =>{
   dispatch(fetchPelote())
 }



 useEffect(() => {

    dispatch();

}, []);

  function Category (props) {
  return <div className="item">{props.menuCategory} </div>
  }

  return (
      <div className="container-boutique-menu">
        <Category menuCategory="Bonnet"/>
        <Category menuCategory="Tour de cou"/>
        <Category menuCategory="Pull"/>
        <Category menuCategory="Gant"/>
        <Category menuCategory="Chaussette"/>
        <Category menuCategory="Chausson"/>
        <Category menuCategory="Plaide"/>
        <Category menuCategory="Pelote"/>   
      </div>
  );
}
